pragma solidity 0.6.4;
pragma experimental ABIEncoderV2;

import "../../core/INetwork.sol";
import "./ExtendedAssets.sol";
import "./Accounts.sol";

contract Orange is INetwork, Accounts {
    using SafeMath for uint256;

    event Deposit(address indexed receiver, bytes32 assetId, uint256 quantity);

    Juice internal _juice;
    Consortium internal _consortium;
    address _assetsAddress;

    // transaction filters
    mapping(bytes16 => address) private filters;

    constructor(address juiceAddress, address consortiumAddress, address publishersAddress, address assetsAddress)
        Accounts(publishersAddress, assetsAddress) public {

        _assetsAddress = assetsAddress;
        _juice = Juice(juiceAddress);
        _consortium = Consortium(consortiumAddress);
    }

    // ----------------------------------------------------------------------------------------------------------
    // ------------------------------------------------ PUBLIC --------------------------------------------------
    // ----------------------------------------------------------------------------------------------------------

    /**
     *  Allocate new asset (created in assets contract)
     */
    function allocate(bytes32 assetId, address receiver, uint256 quantity) public override returns(bool){

        require(
            msg.sender == _assetsAddress,
            "Allocate can only be called from Assets"
        );

        // create local asset
        Asset memory asset;
        asset.exists = true;
        asset.chargeable = true;
        asset.transferLock = 0;
        assets[assetId] = asset;

        // check if transfer is allowed
        verifyTransferable(assetId, receiver);

        // deposit in wallet
        return deposit(receiver, assetId, quantity);
    }

    /**
     * Transfer Digital Asset
     *
     * sender: Address of sender
     * receiver: Address of receiver
     * node: Name of node
     * name: Name of asset
     * amount: Amount of assets to be transferred
    */
    function transfer(address receiver, bytes32 assetId, uint256 amount) public payable returns (bool) {

        // check if transfer is allowed
        verifyTransferable(assetId, receiver);

        // charge for transferFee
        _juice.charge(msg.sender, _consortium.transferFee());

        // withdraw
        withdraw(msg.sender, assetId, amount);

        // deposit
        return deposit(receiver, assetId, amount);
    }

    // ----------------------------------------------------------------------------------------------------------
    // ------------------------------------------------ INTERNAL ------------------------------------------------
    // ----------------------------------------------------------------------------------------------------------

    // *   -transferLock: * 00 : None (From any wallet to any wallets)
    // *                  * 01 : Wallet (From publisher wallets to publishers wallets)
    // *                  * 02 : Publisher (Only publisher can transfer into wallets, owner can return to publisher)
    function verifyTransferable(bytes32 assetId, address receiver) internal view returns (bool) {
        Asset memory a = assets[assetId];

        if (a.transferLock != 0){                                   // 00 : No regulations

            bytes8 publisher = Shared.extractPublisher(assetId);

            if (a.transferLock == 1){                               // 01 : Only Wallet
                bytes8 walletPublisher = _accounts[receiver].publisher;
                require(
                    publisher == walletPublisher,
                    "Transfer only to publisher wallets allowed"
                );
            } else if (a.transferLock == 2){                        // 02 : None   (Only from publisher)
                require(
                    msg.sender == _publishers.getOwner(publisher),
                    "Transfer only allowed by publisher"
                );
            }
        }

        return true;
    }


    /**
     * Deposit assets to wallet
     */
    function deposit(address receiver, bytes32 assetId, uint256 amount) internal returns (bool){

        require(
            _accounts[receiver].active == true,
            "Unknown or invalid wallet"
        );

        // extract assets publisher
        bytes8 publisher = Shared.extractPublisher(assetId);

        // verify transfer is allowed (wallet)
        verifyWalletTransferAllowed(publisher, receiver);

        // add asset to known assets if not owned before
        // (if balance == 0, asset yet not owned)
        if (_accounts[receiver].balance[assetId] == 0) {
            _accounts[receiver].assets.push(assetId);
        }

        // deposit balance
        _accounts[receiver].balance[assetId] = _accounts[receiver].balance[assetId].add(amount);

        // emit event
        emit Deposit(receiver, assetId, amount);

        return true;
    }

    /**
      * Withdraw asset from owner
      *  - remove asset from known assets
      */
    function withdraw(address owner, bytes32 assetId, uint256 amount) internal returns (bool){

        // check if owner has fund
        require(_accounts[owner].balance[assetId] >= amount, "Insufficient balance");


        // withdraw amount from senders wallet
        _accounts[owner].balance[assetId] = _accounts[owner].balance[assetId].sub(amount);

        // if owner is left with no assets (of kind) remove from the owning list
        if (_accounts[owner].balance[assetId] > 0)
            return true;

        // TODO: add limit option to wallet to avoid to high gas-cost (max amount of assets)
        uint arrayLength = _accounts[owner].assets.length;

        // shift last entry to empty space
        for (uint i = 0; i < arrayLength; i++) {
            if (_accounts[owner].assets[i] == assetId) {
                _accounts[owner].assets[i] = _accounts[owner].assets[arrayLength - 1];
            }
        }

        // pop the last entry
        _accounts[owner].assets.pop();

        return true;
    }

    // ------------------------------------------------------------------------------------------------
    // ------------------------------------------------------------------------------------------------

    /**
   *  Check if the asset can be transferred into wallet
   *  according to specified transferLock mode
   */
    function verifyWalletTransferAllowed(bytes8 assetPublisher, address receiver) internal view {

        // check blacklist
        require(_accounts[receiver].blacklist[assetPublisher] == false, "Publisher blacklisted");

        // only whitelist
        if (_accounts[receiver].transferLock == 1 || _accounts[receiver].transferLock == 2) {
            // Publisher is always allowed to transfer into wallet
            if (_accounts[receiver].publisher != assetPublisher) {
                // All others need to be whitelisted
                require(
                    _accounts[receiver].whitelist[assetPublisher] == true,
                    "Publisher not white-listed"
                );
            }
        }

        // only publishers
        if (_accounts[receiver].transferLock == 3) {
            require(
                _accounts[receiver].publisher == assetPublisher,
                "Only assets from publisher allowed in wallet"
            );
        }

    }

    /**
     *  Get wallet balance of specific asset
     */
    function getAssetBalance(bytes32 assetId, address account) public view returns(uint256) {
        return _accounts[account].balance[assetId];
    }

}


